import React from "react";
import { Link } from "react-router-dom";

export default function NavRouter() {
  return (
    <div>
      <Link className="mx-3" to="/">
        Trang chủ
      </Link>
      <Link className="mx-3" to="/dssv">
        Danh sách
      </Link>
      <Link className="mx-3" to="/detail">
        Chi tiết
      </Link>
    </div>
  );
}
